import math
class BeamSearchDecoder:
    def __init__(self, model, beam_size, max_len, start_token, end_token, pad_token):
        """
        :param model: The trained Transformer_NMT_MH model.
        :param beam_size: Number of beams to maintain during decoding.
        :param max_len: Maximum length of the generated sequences.
        :param start_token: Token that indicates the start of a sequence.
        :param end_token: Token that indicates the end of a sequence.
        :param pad_token: Token used for padding.
        """
        self.model = model
        self.beam_size = beam_size
        self.max_len = max_len
        self.start_token = start_token
        self.end_token = end_token
        self.pad_token = pad_token

    def decode(self, src_indices):
        """
        Perform beam search decoding.
        :param src_indices: Input indices for the source sequence.
        :return: The best sequence as a list of token indices.
        """
        batch_size = src_indices.size(0)
        device = src_indices.device

        # Initialize the beams: each beam starts with the start token and score 0
        beams = [(torch.tensor([[self.start_token]], device=device), 0.0)] * self.beam_size
        finished_sequences = []

        with torch.no_grad():
            # Encoder outputs
            enc_output = self.model.src_embedding(src_indices) * math.sqrt(self.model.d_model)
            enc_output = self.model.src_positional_enc(enc_output)
            for layer in self.model.transformer_layers_enc:
                enc_output = layer(enc_output)

            for _ in range(self.max_len):
                all_candidates = []

                for seq, score in beams:
                    # Stop expanding beams that have already finished
                    if seq[0, -1].item() == self.end_token:
                        finished_sequences.append((seq, score))
                        continue

                    tgt_input = self.model.tgt_embedding(seq) * math.sqrt(self.model.d_model)
                    tgt_input = self.model.tgt_positional_enc(tgt_input)

                    dec_output = tgt_input
                    for layer in self.model.transformer_layers_dec:
                        dec_output = layer(enc_output, dec_output)

                    logits = self.model.tgt_out_vocab(dec_output[:, -1, :])
                    log_probs = F.log_softmax(logits, dim=-1)

                    # Get the top beam_size next tokens and their log probabilities
                    topk_probs, topk_indices = log_probs.topk(self.beam_size, dim=-1)

                    for i in range(self.beam_size):
                        candidate_seq = torch.cat([seq, topk_indices[:, i].unsqueeze(0)], dim=1)
                        candidate_score = score + topk_probs[0, i].item()
                        all_candidates.append((candidate_seq, candidate_score))

                # Sort all candidates by score and select top beams
                ordered = sorted(all_candidates, key=lambda x: x[1], reverse=True)
                beams = ordered[:self.beam_size]

                # Stop early if all beams have finished
                if all(seq[0, -1].item() == self.end_token for seq, _ in beams):
                    break

        # Add unfinished beams if needed
        finished_sequences += beams
        # Sort sequences by score
        finished_sequences = sorted(finished_sequences, key=lambda x: x[1], reverse=True)

        # Return the best sequence (excluding padding tokens)
        best_seq = finished_sequences[0][0].squeeze().tolist()
        return [token for token in best_seq if token != self.pad_token]

