"""# ***RNN Language Models***
initialize the hidden state $h_{0}$ and recall that:
$$h^{(t)}=\sigma(W_{h} h^{(t-1)}+W_{e}e^{(t)}+b_{1}) \\ \hat{y}^{(t)}=\textit{softmax}(Uh^{(t)}+b_{2}) \in R^{|V|}$$

$CE$ for cross entropy loss then loss for $(t)-$ th time instance is:

$$J^{(t)}(\theta):=CE(y^{(t)},\hat{y}^{t})=-\log{\hat{y}^{(t)}_{x_{(t+1)}}}$$, ***as by construct,***  $y^{(t)}=x^{(t+1)}$.

**Gradients**
$$\partial_{W_{h}}J^{(t)}(\theta):= \frac{\partial J^{(t)}}{\partial W_{h}}=\frac{\partial J^{(t)}}{\partial \hat{y}^{(t)}} \frac{\partial \hat{y}^{(t)}}{\partial h^{(t)}} \frac{\partial h^{(t)}}{\partial W_{h}}  \\ \partial_{W_{e}}J^{(t)}(\theta)=\frac{\partial J^{(t)}}{\partial W_{e}}=\frac{\partial J^{(t)}}{\partial \hat{y}^{(t)}} \frac{\partial \hat{y}^{(t)}}{\partial h^{(t)}} \frac{\partial h^{(t)}}{\partial W_{e}} \\ \partial_{b_{1}}J^{(t)}(\theta)=\frac{\partial J^{(t)}}{\partial \hat{y}^{(t)}} \frac{\partial \hat{y}^{(t)}}{\partial h^{(t)}} \frac{\partial h^{(t)}}{\partial b_{1}} \\ \partial_{b_{2}}J^{(t)}(\theta) = \frac{\partial J^{(t)}}{\partial \hat{y}^{(t)}} \frac{\partial \hat{y}^{(t)}}{\partial b_{2}}$$

The gradient for overall loss follows as the total loss is $J(\theta):=\frac{1}{T}\sum_{t=1}^{T} J^{(t)}(\theta)$

#**Neural machine translation via RNN**
***Decoder hidden state:***
$$h^{(t)}=\sigma(W_{h} h^{(t-1)}+W_{e}e^{(t-1)}+W_{c}c+b)$$


1.   $e^{(t-1)}$ is the embedding of previously generated word,
2.   $c$ is the context vector from the encoder that captures thne meaning of entire sentence in its original language.

The hidden state $h^{(t)}$ is then used to predict the next word in the target language by applying a softmax over the target vocabulary. This combination allows the decoder to keep track of what it has generated so far (through $h^{(t-1)}$), use the previous word to influence the next word (through $e^{(t-1)}$
, and remain informed about the source sentence content (through the context vector $c$)

# **LSTM**
**Forget gate:** $$f^{(t)}:=\sigma \big(W_{f}h^{(t-1)}+U_{f}x^{(t)}+b_{f}\big)$$
**Input gate:** $$i^{(t)}:=\sigma\big(W_{i}h^{(t-1)}+U_{i}x^{(t)}+b_{i}\big)$$
**Output gate:** $$o^{(t)}:=\sigma\big(W_{o}h^{(t-1)}+U_{o}x^{(t)}+b_{o} \big)$$

LSTM comprises of *hidden state* and a *cell state*.

**New cell content:**
New content to be written in the cell
$$\hat{c}^{(t)}=tanh \big(W_{c} h^{(t-1)}+U_{c}x^{(t)}+b_{c}\big)$$

**Cell-state:** $$c^{(t)}=f^{(t)}∘c^{(t-1)}+i^{(t)} \circ \hat{c}^{(t)}$$, where $\circ$ represent elmentwise product(Hadamard product).

**Hidden-state:** $$h^{(t)}=o^{(t)} \circ tanh(c^{(t)})$$

where recall that $tanh \in [-1,1]$
"""

