"""![simple_nmt.png](data:image/png;base64,)

![train_rnn_language.png](data:image/png;base64,)

## ***Mathematical Description (Training procedure)***
Model uses a *bidirectional LSTM*  for source language sentence encoding. Let $x_{1},\ldots,x_{m}$ be the embeddings of source sentence with each $x_{i} \in \mathbb{R}^{e \times 1}$ for $i \in [m]$. Last hidden/cell state of forward directional encoder and first hidden/cell state of backward directional encoder are concatenated and projected via linear transforms $W_{h},W_{c} \in \mathbb{R}^{h \times 2h}$.
$$h_{0}^{\textit{dec}}=W_{h}[\overleftarrow{h_{1}^{\textit{enc}}};\overrightarrow{h_{m}^{\textit{enc}}}] \\ c_{0}^{\textit{dec}}=W_{c}[\overleftarrow{c_{1}^{\textit{enc}}};\overrightarrow{c_{m}^{\textit{enc}}}] $$
Decoders hidden state dynamics follow:
$$h_{t}^{\textit{dec}},c_{t}^{\textit{dec}}=\textit{Decoder}(\overline{y_{t}},h_{t-1}^{\textit{dec}},c_{t-1}^{\textit{dec}})$$,

where we use $h_{t}^{\textit{dec}}$ to compute multiplicative attention over $h_{1}^{\textit{enc}}, \ldots, h_{m}^{\textit{enc}}$:
Now compute attention scores wrt the encoders over time sequence (lets say $m$), then for all $i \in [m]$
$$e_{t,i}=\langle h_{t}^{\textit{dec}},W_{\textit{attProj}} h_{i}^{\textit{enc}}\rangle, \hspace{5pt} W_{\textit{attProj}} \in \mathbb{R}^{h \times 2h}$$
followed by *attention probability(weights)*
$$\alpha_{t}=\textit{softmax}(e_{t}), \hspace{5pt} e_{t} \in \mathbb{R}^{m \times 1}$$ and consequently *attention output*
$$a_{t}:=\sum_{i=1}^{m}\alpha_{t,i}h_{i}^{\textit{enc}} \in \mathbb{R}^{2h \times 1}$$
Nows concatenate attention output and hidden state of decoder to get $u_{t}=[a_{t}; h_{t}^{\textit{dec}}]\in \mathbb{R}^{3h \times 1}$ and then using *combined output projection matrix* $W_{u} \in \mathbb{R}^{h \times 3h}$, let:
$$v_{t}=W_{u}u_{t} \hspace{2pt} \textit{then} \hspace{2pt} o_{t}:=\textit{dropout}\big(tanh(v_{t})\big)$$  and if $V_{\textit{tgt}}$ is the vocab size of target language then we use *target vocab projection matrix* $W_{\textit{vocab}} \in \mathbb{R}^{V_{\textit{tgt}}\times h}$ we get the output probabibilities
$$P_{t}=\textit{softmax}(W_{\textit{vocab}}o_{t}) \in \mathbb{R}^{V_{\textit{tgt}}\times 1}$$

On the $t-$ th step we look up at the embedding of the $t-$ th subword $y_{t} \in \mathbb{R}^{e \times 1}$ and concatenate it with $o_{t-1} \in \mathbb{R}^{h \times 1}$ to get input for the decoder at $t-$ th step:
$$\overline{y}_{t}:=[y_{t}; o_{t-1}] \in \mathbb{R}^{(h+e) \times 1}$$
Finally, to train the network we then compute the softmax cross entropy loss between $P_{t}$ and $g_{t}$, where $g_{t}$ is the one-hot vector of the target subword at timestep
$t$ and associated loss at the $t-$th decoding step is:

$$J_{t}(\theta):=\textit{CrossEntropy}(P_{t},g_{t})$$
where $\theta$ represents all the trainable parameters of the architecture.
"""

def step(self, Ybar_t: torch.Tensor, dec_state: Tuple[torch.Tensor, torch.Tensor],
         enc_hiddens: torch.Tensor, enc_hiddens_proj: torch.Tensor,
         enc_masks: torch.Tensor) -> Tuple[Tuple[torch.Tensor, torch.Tensor], torch.Tensor, torch.Tensor]:

    # Step 1: Pass Ybar_t through the decoder LSTM
      dec_hidden, dec_cell = self.decoder(Ybar_t, dec_state)  # dec_hidden, dec_cell: (b, h)
      dec_state = (dec_hidden, dec_cell)
    # Step 2: Compute attention scores e_t (b, src_len)
      dec_hidden_unsq = dec_hidden.unsqueeze(1)  # (b, 1, h)

    # Ensure enc_hiddens_proj has shape (b, src_len, h)
      e_t = torch.bmm(enc_hiddens_proj, dec_hidden_unsq.transpose(1, 2)).squeeze(2)  # (b, src_len)


    # Step 3: Mask padded positions in attention scores
      if enc_masks is not None:
        e_t.data.masked_fill_(enc_masks == 0, float('-inf'))

    # Step 4: Compute attention distribution alpha_t (b, src_len)
      alpha_t = torch.softmax(e_t, dim=1)  # (b, src_len)

    # Step 5: Compute the context vector c_t (b, h*2)
      c_t = torch.bmm(alpha_t.unsqueeze(1), enc_hiddens).squeeze(1)  # (b, h*2)

    # Step 6: Concatenate context vector and decoder hidden state, then pass through output projection
      U_t = torch.cat([c_t, dec_hidden], dim=1)  # (b, h*2 + h)
      V_t = self.combined_output_projection(U_t)  # (b, h)

    # Step 7: Apply dropout and Tanh activation
      o_t = torch.tanh(V_t)  # (b, h)
      o_t = self.dropout(o_t)

      return dec_state, o_t, e_t

